;WITH CTE AS ( SELECT *, ROW_NUMBER() OVER(PARTITION BY [zip], [type], [primary_city], [state], [county], [latitude], [longitude], [country] ORDER BY [zip], [type], [primary_city], [state], [county], [latitude], [longitude], [country]) 
